pub fn check_array<T>(user_buf: *const T, count: usize) -> Result<()> {
        let checked_len = count
            .checked_mul(size_of::<T>())
            .ok_or_else(|| errno!(EINVAL, "the array is too long"))?;
        if !is_inside_user_space(user_buf as *const u8, checked_len) {
